import { Trans } from "@lingui/macro";
import { useAtomValue } from "jotai/utils";
import { ForwardedRef, forwardRef } from "react";
import { ReactNode } from "react";
import { ArrowDown, ArrowUp } from "react-feather";
import { Link } from "react-router-dom";
import styled, { css, useTheme } from "styled-components/macro";
import { ClickableStyle } from "theme";
import DoubleCurrencyLogo from "components/DoubleLogo2";
import { feeTierPercent } from "utils";
import { formatDollarAmount } from "utils/numbers";
import { useActiveNetworkVersion } from "state/application/hooks";
import { networkPrefix } from "utils/networkPrefix";
import {
  LARGE_MEDIA_BREAKPOINT,
  MAX_WIDTH_MEDIA_BREAKPOINT,
  MEDIUM_MEDIA_BREAKPOINT,
  SMALL_MEDIA_BREAKPOINT,
} from "../constants";
import { LoadingBubble } from "../loading";
import {
  filterStringAtom,
  sortAscendingAtom,
  sortMethodAtom,
  TokenSortMethod,
  useSetSortMethod,
} from "../state";
import InfoTip from "../PoolDetails/InfoTip";

const Cell = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`;
const StyledTokenRow = styled.div<{
  first?: boolean;
  last?: boolean;
  loading?: boolean;
}>`
  background-color: transparent;
  display: grid;
  font-size: 16px;
  grid-template-columns: 1fr 7fr 4fr 4fr 4fr 4fr 5fr;
  line-height: 24px;
  max-width: ${MAX_WIDTH_MEDIA_BREAKPOINT};
  min-width: 390px;
  ${({ first, last }) => css`
    height: ${first || last ? "72px" : "64px"};
    padding-top: ${first ? "8px" : "0px"};
    padding-bottom: ${last ? "8px" : "0px"};
  `}
  padding-left: 12px;
  padding-right: 12px;
  transition: ${({
    theme: {
      transition: { duration, timing },
    },
  }) => css`background-color ${duration.medium} ${timing.ease}`};
  width: 100%;
  transition-duration: ${({ theme }) => theme.transition.duration.fast};

  &:hover {
    ${({ loading, theme }) =>
      !loading &&
      css`
        background-color: ${theme.hoverDefault};
      `}
    ${({ last }) =>
      last &&
      css`
        border-radius: 0px 0px 8px 8px;
      `}
  }

  @media only screen and (max-width: ${MAX_WIDTH_MEDIA_BREAKPOINT}) {
    grid-template-columns: 1fr 6.5fr 4.5fr 4.5fr 4.5fr 4.5fr 1.7fr;
  }

  @media only screen and (max-width: ${LARGE_MEDIA_BREAKPOINT}) {
    grid-template-columns: 1fr 7.5fr 4.5fr 4.5fr 4.5fr 1.7fr;
  }

  @media only screen and (max-width: ${MEDIUM_MEDIA_BREAKPOINT}) {
    grid-template-columns: 1fr 10fr 5fr 5fr 1.2fr;
  }

  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    grid-template-columns: 2fr 3fr;
    min-width: unset;
    border-bottom: 0.5px solid ${({ theme }) => theme.backgroundModule};

    :last-of-type {
      border-bottom: none;
    }
  }
`;

const ClickableContent = styled.div`
  display: flex;
  text-decoration: none;
  color: ${({ theme }) => theme.textPrimary};
  align-items: center;
  cursor: pointer;
`;
const ClickableName = styled(ClickableContent)`
  gap: 8px;
  max-width: 100%;
`;
const StyledHeaderRow = styled(StyledTokenRow)`
  border-bottom: 1px solid;
  border-color: ${({ theme }) => theme.backgroundOutline};
  border-radius: 8px 8px 0px 0px;
  color: ${({ theme }) => theme.textSecondary};
  font-size: 14px;
  height: 48px;
  line-height: 16px;
  padding: 0px 12px;
  width: 100%;
  justify-content: center;

  &:hover {
    background-color: transparent;
  }

  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    justify-content: space-between;
  }
`;

const ListNumberCell = styled(Cell)<{ header: boolean }>`
  color: ${({ theme }) => theme.textSecondary};
  min-width: 32px;
  font-size: 14px;

  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    display: none;
  }
`;
const DataCell = styled(Cell)<{ sortable: boolean }>`
  justify-content: flex-end;
  min-width: 80px;
  user-select: ${({ sortable }) => (sortable ? "none" : "unset")};
  transition: ${({
    theme: {
      transition: { duration, timing },
    },
  }) => css`background-color ${duration.medium} ${timing.ease}`};
`;
const TvlCell = styled(DataCell)`
  padding-right: 8px;
  @media only screen and (max-width: ${MEDIUM_MEDIA_BREAKPOINT}) {
    display: none;
  }
`;
const NameCell = styled(Cell)`
  justify-content: flex-start;
  padding: 0px 8px;
  min-width: 240px;
  gap: 8px;
`;
const PriceCell = styled(DataCell)`
  padding-right: 8px;
`;
const PercentChangeCell = styled(DataCell)`
  padding-right: 8px;
  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    display: none;
  }
`;
const PercentChangeInfoCell = styled(Cell)`
  display: none;

  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    display: flex;
    justify-content: flex-end;
    color: ${({ theme }) => theme.textSecondary};
    font-size: 12px;
    line-height: 16px;
  }
`;
const PriceInfoCell = styled(Cell)`
  justify-content: flex-end;
  flex: 1;

  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    flex-direction: column;
    align-items: flex-end;
  }
`;

const HeaderCellWrapper = styled.span<{ onClick?: () => void }>`
  align-items: center;
  cursor: ${({ onClick }) => (onClick ? "pointer" : "unset")};
  display: flex;
  gap: 4px;
  height: 100%;
  justify-content: flex-end;
  width: 100%;

  &:hover {
    ${ClickableStyle}
  }
`;
const SparkLineCell = styled(Cell)`
  padding: 0px 24px;
  min-width: 120px;

  @media only screen and (max-width: ${MAX_WIDTH_MEDIA_BREAKPOINT}) {
    display: none;
  }
`;
const SparkLine = styled(Cell)`
  width: 124px;
  height: 42px;
`;
const StyledLink = styled(Link)`
  text-decoration: none;
`;
const TokenInfoCell = styled(Cell)`
  gap: 8px;
  line-height: 24px;
  font-size: 16px;
  max-width: inherit;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;

  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    justify-content: flex-start;
    flex-direction: column;
    gap: 0px;
    width: max-content;
    font-weight: 500;
  }
`;
const TokenName = styled.div`
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  max-width: 100%;
`;
const TokenSymbol = styled(Cell)`
  color: ${({ theme }) => theme.textTertiary};
  text-transform: uppercase;

  @media only screen and (max-width: ${SMALL_MEDIA_BREAKPOINT}) {
    font-size: 12px;
    height: 16px;
    justify-content: flex-start;
    width: 100%;
  }
`;
const VolumeCell = styled(DataCell)`
  padding-right: 8px;
  @media only screen and (max-width: ${LARGE_MEDIA_BREAKPOINT}) {
    display: none;
  }
`;
const SmallLoadingBubble = styled(LoadingBubble)`
  width: 25%;
`;
const MediumLoadingBubble = styled(LoadingBubble)`
  width: 65%;
`;
const LongLoadingBubble = styled(LoadingBubble)`
  width: 90%;
`;
const IconLoadingBubble = styled(LoadingBubble)`
  border-radius: 50%;
  width: 24px;
`;
export const SparkLineLoadingBubble = styled(LongLoadingBubble)`
  height: 4px;
`;

export const L2NetworkLogo = styled.div<{ networkUrl?: string; size?: string }>`
  height: ${({ size }) => size ?? "12px"};
  width: ${({ size }) => size ?? "12px"};
  position: absolute;
  left: 50%;
  bottom: 0;
  background: url(${({ networkUrl }) => networkUrl});
  background-repeat: no-repeat;
  background-size: ${({ size }) => (size ? `${size} ${size}` : "12px 12px")};
  display: ${({ networkUrl }) => !networkUrl && "none"};
`;
export const LogoContainer = styled.div`
  position: relative;
  align-items: center;
  display: flex;
`;

export const HEADER_DESCRIPTIONS: Record<
  TokenSortMethod,
  ReactNode | undefined
> = {
  [TokenSortMethod.feeTier]: undefined,
  [TokenSortMethod.tvlUSD]: (
    <Trans>
      Total value locked (TVL) is the amount of the asset thatâ€™s currently in a
      Uniswap v3 liquidity pool.
    </Trans>
  ),
  [TokenSortMethod.tvlUSDChange]: undefined,
  [TokenSortMethod.volumeUSD]: (
    <Trans>
      Volume is the amount of the asset that has been traded on Uniswap v3
      during 24 hours.
    </Trans>
  ),
  [TokenSortMethod.volumeUSDWeek]: (
    <Trans>
      Volume is the amount of the asset that has been traded on Uniswap v3
      during 7 days.
    </Trans>
  ),
};

/* Get singular header cell for header row */
function HeaderCell({
  category,
}: {
  category: TokenSortMethod; // TODO: change this to make it work for trans
}) {
  const theme = useTheme();
  const sortAscending = useAtomValue(sortAscendingAtom);
  const handleSortCategory = useSetSortMethod(category);
  const sortMethod = useAtomValue(sortMethodAtom);

  const description = HEADER_DESCRIPTIONS[category];

  return (
    <HeaderCellWrapper onClick={handleSortCategory}>
      {sortMethod === category && (
        <>
          {sortAscending ? (
            <ArrowUp size={20} strokeWidth={1.8} color={theme.accentActive} />
          ) : (
            <ArrowDown size={20} strokeWidth={1.8} color={theme.accentActive} />
          )}
        </>
      )}

      {category === "feeTier"
        ? "Fee Tier"
        : category === "tvlUSD"
        ? "TVL"
        : category === "volumeUSDWeek"
        ? "Volume 7D"
        : category === "volumeUSD"
        ? "Volume 24h"
        : category === "tvlUSDChange"
        ? "TVL USD Change"
        : category}
      {description && <InfoTip text={description}></InfoTip>}
    </HeaderCellWrapper>
  );
}

/* Token Row: skeleton row component */
function TokenRow({
  header,
  listNumber,
  tokenInfo,
  price,
  tvl,
  tvlUSDChange,
  volume,
  volumeUSDWeek,
  ...rest
}: {
  first?: boolean;
  header: boolean;
  listNumber: ReactNode;
  loading?: boolean;
  tvl: ReactNode;
  tvlUSDChange: ReactNode;
  price: ReactNode;
  volumeUSDWeek?: ReactNode;
  tokenInfo: ReactNode;
  volume: ReactNode;
}) {
  const rowCells = (
    <>
      <ListNumberCell header={header}>{listNumber}</ListNumberCell>
      <NameCell>{tokenInfo}</NameCell>
      <PriceCell sortable={header}>{price}</PriceCell>
      <TvlCell sortable={header}>{tvl}</TvlCell>
      <TvlCell sortable={header}>{tvlUSDChange}</TvlCell>
      <VolumeCell sortable={header}>{volume}</VolumeCell>
      <VolumeCell sortable={header}>{volumeUSDWeek}</VolumeCell>
    </>
  );
  if (header) return <StyledHeaderRow>{rowCells}</StyledHeaderRow>;

  return <StyledTokenRow {...rest}>{rowCells}</StyledTokenRow>;
}

/* Header Row: top header row component for table */
export function HeaderRow() {
  return (
    <TokenRow
      header={true}
      listNumber="#"
      tokenInfo={<Trans>Pool name</Trans>}
      price={<HeaderCell category={TokenSortMethod.feeTier} />}
      tvl={<HeaderCell category={TokenSortMethod.tvlUSD} />}
      tvlUSDChange={<HeaderCell category={TokenSortMethod.tvlUSDChange} />}
      volume={<HeaderCell category={TokenSortMethod.volumeUSD} />}
      volumeUSDWeek={<HeaderCell category={TokenSortMethod.volumeUSDWeek} />}
    />
  );
}

/* Loading State: row component with loading bubbles */
export function LoadingRow(props: { first?: boolean; last?: boolean }) {
  return (
    <TokenRow
      header={false}
      listNumber={<SmallLoadingBubble />}
      loading
      tokenInfo={
        <>
          <IconLoadingBubble />
          <MediumLoadingBubble />
        </>
      }
      price={<MediumLoadingBubble />}
      tvl={<LoadingBubble />}
      tvlUSDChange={<LoadingBubble />}
      volume={<LoadingBubble />}
      volumeUSDWeek={<LoadingBubble />}
      {...props}
    />
  );
}

interface LoadedRowProps {
  poolData: any;
  tokenListIndex: number;
  totalPools: number;
}

/* Loaded State: row component with token information */
export const LoadedRow = forwardRef(
  (props: LoadedRowProps, ref: ForwardedRef<HTMLDivElement>) => {
    const { poolData, tokenListIndex, totalPools } = props;
    const poolAddress = poolData.address;

    const [activeNetwork] = useActiveNetworkVersion();

    const filterString = useAtomValue(filterStringAtom);
    const sortAscending = useAtomValue(sortAscendingAtom);

    // const lowercaseChainName = useParams<{ chainName?: string }>().chainName?.toUpperCase() ?? 'ethereum'
    // const filterNetwork = lowercaseChainName.toUpperCase()
    // const chainId = CHAIN_NAME_TO_CHAIN_ID[filterNetwork]
    // const L2Icon = getChainInfo(chainId)?.circleLogoUrl
    // const timePeriod = useAtomValue(filterTimeAtom)
    // const delta = token.market?.pricePercentChange?.value
    // const arrow = getDeltaArrow(delta)
    // const smallArrow = getDeltaArrow(delta, 14)
    // const formattedDelta = formatDelta(delta)
    const rank = sortAscending
      ? totalPools - tokenListIndex
      : tokenListIndex + 1;

    // const exploreTokenSelectedEventProperties = {
    //   chain_id: chainId,
    //   token_address: tokenAddress,
    //   token_symbol: tokenSymbol,
    //   token_list_index: tokenListIndex,
    //   token_list_rank: rank,
    //   token_list_length: tokenListLength,
    //   time_frame: timePeriod,
    //   search_token_address_input: filterString,
    // }

    // TODO: currency logo sizing mobile (32px) vs. desktop (24px)
    return (
      <div ref={ref} data-testid={`token-table-row-${poolAddress}`}>
        <StyledLink to={networkPrefix(activeNetwork) + "pools/" + poolAddress}>
          <TokenRow
            header={false}
            listNumber={rank}
            tokenInfo={
              <ClickableName>
                <LogoContainer>
                  <DoubleCurrencyLogo
                    address0={poolData?.token0?.address}
                    address1={poolData?.token1?.address}
                  />
                </LogoContainer>
                <TokenInfoCell>
                  <TokenName>{poolData?.token0?.symbol}</TokenName>
                  <TokenSymbol>{poolData?.token1?.symbol}</TokenSymbol>
                </TokenInfoCell>
              </ClickableName>
            }
            price={
              <ClickableContent>
                <PriceInfoCell>
                  {feeTierPercent(poolData.feeTier)}
                </PriceInfoCell>
              </ClickableContent>
            }
            tvl={
              <ClickableContent>
                {formatDollarAmount(poolData.tvlUSD)}
              </ClickableContent>
            }
            tvlUSDChange={
              <ClickableContent>
                {formatDollarAmount(poolData.tvlUSDChange)}
              </ClickableContent>
            }
            volume={
              <ClickableContent>
                {formatDollarAmount(poolData.volumeUSD)}
              </ClickableContent>
            }
            volumeUSDWeek={
              <ClickableContent>
                {formatDollarAmount(poolData.volumeUSDWeek)}
              </ClickableContent>
            }
          />
        </StyledLink>
      </div>
    );
  }
);

LoadedRow.displayName = "LoadedRow";
